    <script>
        var db = firebase.database().ref('home');


        db.on('value', function(data) {

            console.log("data: ", data.val());
            $("#checkLed1").prop('checked', data.val().led1);
            $("#checkLed2").prop('checked', data.val().led2);
            $("#checkLed3").prop('checked', data.val().led3);
            $("#checkLed10").prop('checked', data.val().led10);
            $("#checkLed11").prop('checked', data.val().led11);
            $("#myTextBox").val(data.val().text1);
            if ($("#checkLed1").is(':checked') == true) {
                document.getElementById("led1_polygon").classList.add("active");
            } else {
                document.getElementById("led1_polygon").classList.remove("active");
            };
            if ($("#checkLed2").is(':checked') == true) {
                document.getElementById("led2_polygon").classList.add("active");
            } else {
                document.getElementById("led2_polygon").classList.remove("active");
            };
            if ($("#checkLed3").is(':checked') == true) {
                document.getElementById("salon_polygon").classList.add("active");
            } else {
                document.getElementById("salon_polygon").classList.remove("active");
            };
            if ($("#checkLed10").is(':checked') == true) {
                document.getElementById("front_polygon").classList.add("active");
            } else {
                document.getElementById("front_polygon").classList.remove("active");
            };
            if ($("#checkLed11").is(':checked') == true) {
                document.getElementById("back_path").classList.add("active");
            } else {
                document.getElementById("back_path").classList.remove("active");
            };

        })
        $("#checkLed1" || "led1_polygon").click(function() {
            var zmiana = $(this).is(':checked');

            if (zmiana) {
                db.update({
                    led1: true
                });
                document.getElementById("led1_polygon").classList.add("active");

            } else {
                db.update({
                    led1: false
                });
                document.getElementById("led1_polygon").classList.remove("active");
            }

        });
        $("#checkLed2").click(function() {

            var zmiana2 = $(this).is(':checked');
            if (zmiana2) {
                db.update({
                    led2: true
                });
                document.getElementById("led2_polygon").classList.add("active");
            } else {
                db.update({
                    led2: false
                });
                document.getElementById("led2_polygon").classList.remove("active");
            }

        });
        $("#checkLed3").click(function() {

            var zmiana2 = $(this).is(':checked');
            if (zmiana2) {
                db.update({
                    led3: true
                });
                document.getElementById("salon_polygon").classList.add("active");
            } else {
                db.update({
                    led3: false
                });
                document.getElementById("salon_polygon").classList.remove("active");
            }

        });
        $("#checkLed10" || "#front_polygon").click(function() {
            var zmiana = $(this).is(':checked');

            if (zmiana) {
                db.update({
                    led10: true
                });
                document.getElementById("front_polygon").classList.add("active");

            } else {
                db.update({
                    led10: false
                });
                document.getElementById("front_polygon").classList.remove("active");
            }

        });
        $("#checkLed11" || "#back_path").click(function() {
            var zmiana = $(this).is(':checked');

            if (zmiana) {
                db.update({
                    led11: true
                });
                document.getElementById("back_path").classList.add("active");

            } else {
                db.update({
                    led11: false
                });
                document.getElementById("back_path").classList.remove("active");
            }

        });

        $("#myTextBox").on("change paste keyup", function() {
            db.update({
                text1: ($(this).val())
            });

        });
    </script>
